function S1 = importfile(filename, startRow, endRow)
%IMPORTFILE1 Import numeric data from a text file as a matrix.
%   S2 = IMPORTFILE1(FILENAME) Reads data from text file FILENAME for the
%   default selection.
%
%   S2 = IMPORTFILE1(FILENAME, STARTROW, ENDROW) Reads data from rows
